import { useNavigate } from "react-router-dom";


const Home = ()=>{
    const navigate = useNavigate();
    const {isLoggedIn} = useAuth();

    console.log("Logged In "+isLoggedIn);

    if (!isLoggedIn) {
        // Redirect to the login page if not logged in
        navigate("/login");
    }

    return(
        <h1>Its Home Baby</h1>
    )

}

export default Home ;
